const extensions = () => [...corePreset(), ...wysiwygPreset(), new ColumnsExtension()];

export const FixedToolbarEditor = () => {
  const { manager, state } = useRemirror({
    extensions,
    content: mediumContent,
    selection: 'end',
    stringHandler: 'html',
  });

  return (
    <ThemeProvider>
      <Remirror manager={manager} initialContent={state} autoFocus placeholder='Enter your text'>
        <Toolbar items={toolbarItems} refocusEditor label='Top Toolbar' />
        <EditorComponent />
        <FloatingToolbar items={floatingToolbarItems} positioner='selection' />
        {/* <FloatingToolbar
          items={floatingBlockToolbarItems}
          placement='right-end'
          positioner='emptyBlockStart'
        /> */}
      </Remirror>
    </ThemeProvider>
  );
};

